import Buttons from '../components/buttons/Buttons';
import EditableTable from '../components/table/EditableTable';

function Skills(props) {
  return (
    <>
      <Buttons />
      <EditableTable
        JobLink="Skills"
        jobTitleT="Job Title"
        jobTitle="title"
        jobLocationT="Job Location"
        jobLocation="location"
        location1="New York"
        location2="London"
        startDateT="Start Date"
        startDate="Sdate"
        endDateT="End Date"
        endDate="Edate"
        statusT="Status"
        status="status"
      />
    </>
  );
}

export default Skills;
